var Publish_Blog_Helper = new (function c_Publish_Blog_Helper() {

    var _self = this;

    var _id_single_post = null;

    this.getIdSinglePost = function() {
        return _id_single_post;
    }
    ;

    this.load = function(url, data, callBack) {

        if (typeof Publicar != 'undefined' && Publicar.getOptions('isolatedPublication') === true) {
            url = 'https://www.omb11.com' + url;
        }

        data.identify = typeof Publicar != 'undefined' ? Publicar.getOptions('idLayout') : HTML_Load.getConfig('identify');

        $.ajax({
            url: url,
            type: 'GET',
            dataType: 'json',
            headers: {
                'identify': typeof Publicar != 'undefined' ? Publicar.getOptions('idLayout') : HTML_Load.getConfig('identify'),
                'Content-Type': 'application/x-www-form-urlencoded'
            },
            data: data,
            success: function(data) {
                if (typeof data.results != 'undefined') {
                    callBack(data.results);
                } else {
                    callBack(data);
                }
            },
            error: function() {}
        });

    }
    ;

    this.regionalDate = function() {
        $.datepicker.setDefaults($.datepicker.regional[typeof Publicar != 'undefined' ? Publicar.getOptions('lang').toLowerCase() : (helper.getLanguage() == 'pt_br' ? 'pt_br' : '')]);
    }
    ;

    this.formatDate = function(format, date) {
        return $.datepicker.formatDate(format, new Date(date));
    }
    ;

    this.previewFeedPage = function() {
        var config = Factory.getConfig('Blog');
        var page = HTML_Structure_Controller.getPageByIdPage(config.id_feed_page);
        var layout = page.getLayout();

        if (Publish_Transition.getCurrentPageID() != page.getIdEditor()) {
            layout.load(function(layoutHTML) {
                page.load(function(pageHTML) {
                    Publish_Transition.transition(layoutHTML, pageHTML);
                });
            });
        }
    }

    this.previewSinglePage = function(id_news) {

        _id_single_post = id_news;

        var config = Factory.getConfig('Blog');
        var page = HTML_Structure_Controller.getPageByIdPage(config.id_single_page);
        var layout = page.getLayout();

        if (Publish_Transition.getCurrentPageID() != page.getIdEditor()) {
            layout.load(function(layoutHTML) {
                page.load(function(pageHTML) {
                    Publish_Transition.transition(layoutHTML, pageHTML);
                });
            });
        }
    }
    ;

    return _self;
}
)();

var Publish_Blog_TagCloud = function(node, dataConfig) {

    var _self = this;

    this.loadData = function() {
        Publish_Blog_Helper.load('/api/blog-flags', {
            filter: 'tag',
            count: 1
        }, _self.buildHTML);
    }
    ;

    this.buildHTML = function(data) {

        var css = $.extend(dataConfig.styleText, {
            'text-decoration': 'none',
            'text-align': 'right'
        });
        var config = dataConfig.config;

        $(node).removeAttr('style').empty();

        if (typeof dataConfig.config['inlineCloud'] != 'undefined' && dataConfig.config['inlineCloud'] == true) {
            $(node).css({
                'white-space': 'nowrap',
                'text-overflow': 'ellipsis',
                'overflow': 'hidden',
                'cursor': 'pointer'
            });
        } else {
            $(node).css({
                'overflow': 'hidden',
                'word-wrap': 'break-word',
                'cursor': 'pointer'
            });
        }

        $.map(data, function(element) {
            var href = $('<a>').css(css).appendTo(node);

            if (typeof HTML_Load == 'undefined') {
                var siteName = Publicar.getOptions('sitename');

                var url = element.text;

                if (typeof Publicar != 'undefined' && Publicar.getOptions('isolatedPublication') === true) {
                    url = url.replace(/ /g, "-").toLowerCase();
                    url = encodeURI(url);
                } else {
                    url = (siteName != null && siteName != '' ? '/' + siteName + '/' : '/') + encodeURI(encodeURI(element.text)) + '+t' + element.id_blog_flag;
                }

                url = '/tag/' + url;

                href.attr('href', url);
            }
            if (typeof HTML_Load != 'undefined' && HTML_Load.isPreview()) {
                href.on('click', function() {
                    Publish_Blog_Helper.previewFeedPage();
                });
            }

            var fontSize = parseInt(css['font-size']) + (config.sizeFixed == false ? parseInt(element.amount * 2) : 0);

            $('<span>').css('font-size', fontSize + 'px').text(element.text).appendTo(href);
        });
    }
    ;
};

