var Publish_Blog_Slider = function(node, dataConfig) {

    var _self = this;
    var _config;
    var _index = 0;
    var _interval;
    var _count = 0;

    this.loadData = function() {

        _config = dataConfig.config;

        Publish_Blog_Helper.load('/api/blog-news', {
            featured: _config.onlyFeatured,
            category: _config.category,
            tag: _config.tag,
            limit: _config.amount
        }, _self.buildHTML);
    }
    ;

    this.buildHTML = function(data) {

        var cssTitle = dataConfig.styleText['title'];
        var cssDate = $.extend({
            'display': 'block'
        }, dataConfig.styleText['date']);

        $(node).css({
            'cursor': 'pointer'
        }).empty();

        Publish_Blog_Helper.regionalDate();

        $.each(data, function(index, element) {
            _count++;
            var container = $('<div>').addClass('slider-blog-item').css({
                display: 'none',
                position: 'absolute',
                'width': '100%',
                'height': '100%'
            }).attr('data-ref', index).appendTo(node);

            var href = $('<a>').css({
                'text-decoration': 'none',
                'display': 'block',
                'position': 'relative',
                'height': '100%'
            }).appendTo(container);

            if (typeof HTML_Load == 'undefined') {
                var siteName = Publicar.getOptions('sitename');
                href.attr('href', (siteName != null && siteName != '' ? '/' + siteName + '/' : '/') + element.url + '+' + element.id_blog_news);

                if (node.parent()[0].classList.contains('blogRemaster')) {
                    href.attr('href', (siteName != null && siteName != '' ? '/' + siteName + '/' : '/') + element.url);

                }
            }
            if (typeof HTML_Load != 'undefined' && HTML_Load.isPreview()) {
                href.on('click', function() {
                    Publish_Blog_Helper.previewSinglePage();
                });
            }

            if (_config.showImg == true && element.img != '') {
                $('<img>').addClass('slider-blog-img img-responsive').css({
                    'width': '100%',
                    'height': '75%',
                    float: 'right'
                })//.attr('src', "/generate/thumb/" + helper.toBase64(element.img))
                .attr('src', element.img).appendTo(href);
            }
            if (_config.showTitle == true) {
                $('<p>').addClass('slider-blog-img').css(cssTitle).text(element.title).appendTo(href);
            }

            console.log(_config);
            var postDate = '';
            if (element.date === '0000-00-00 00:00:00') {
                postDate = element.date_create;
            } else {
                if (element.date === '') {
                    postDate = element.date_create;
                } else {
                    postDate = element.date;
                }
            }

            if (_config.showDate == true) {
                try {
                    var _date = $.datepicker.formatDate(_config.format, new Date(XDate(postDate).toString() + ''));

                } catch (e) {

                    var _date = $.datepicker.formatDate('yy/m/d', new Date(XDate(postDate).toString() + ''));

                }

                console.log(_date);
                $('<p>').addClass('slider-blog-img').css(cssDate).text(_date).appendTo(href);
            }

        });

        _show(0);
        if (typeof Publicar != 'undefined' || HTML_Load.isPreview()) {
            $(node).on('mouseenter', function() {
                _self.stop();
            }).on('mouseleave', function() {
                _self.start();
            });

            _self.start();
        }
    }
    ;

    this.stop = function() {
        clearInterval(_interval);
    }
    ;

    this.start = function() {
        _interval = setInterval(function() {
            _self.rotateSlider();
        }, _config.speed * 1000)
    }
    ;

    this.rotateSlider = function() {
        _close(_index);
        _index++;
        if (_index >= _config.amount || _index >= _count) {
            _index = 0;
        }
        _show(_index);
    }
    ;

    function _close(index) {
        $(node).find('.slider-blog-item[data-ref="' + index + '"]').hide(_config.effect || 'fade', 500);
        $(node).find('.slider-blog-item[data-ref="' + index + '"]').removeClass('selected');
    }
    ;
    function _show(index) {
        $(node).find('.slider-blog-item[data-ref="' + index + '"]').show(_config.effect || 'fade', 500);
        $(node).find('.slider-blog-item[data-ref="' + index + '"]').addClass('selected');
    }
    ;

};

